import { Router } from './router';
import { FormProvider } from './contexts/FormContext';
import React, {Component, useEffect, useState} from 'react';


type Api ={
  name: string;
  level: string;
  email: string;
  github: string;
  description: string;
}


const App = () => {
 const[apis, setApis] = useState<Api[]>([])

 useEffect(() =>{
   fetch('http://localhost:3000/api')
   .then(response=>response.json())
   .then(data=>{
     setApis(data);
   })
 }, [])


 return (

    <FormProvider>
       <Router />
      <ul>
        {apis.map(api =>{
          return(
            <li key={api.name}>
            <strong>{api.level}</strong>
            <strong>{api.email}</strong>
            <strong>{api.github}</strong>
            <p>(api.description)</p>

            </li>
          )
        })}
      </ul>

    </FormProvider>
  );

}

export default App;
